# Sparse Matrix Storage and the Page Rank Algorithm

import random
import time

def dot(x : list, y : list) -> int:
    """Return the dot product of two vectors x and y"""
    return sum([a*b for a, b in zip(x, y)])

def calc_error(v : list, vlast : list) -> int:
    """Returns the error between two matrices
    error = length(vlast - v)
    """
    diff = [b-a for a, b in zip(v, vlast)]
    return dot(diff, diff)**(1/2)

def sparse_mult(A, x):
    aA, jA, iA = A

    m = len(x)
    prod = [0 for i in range(m)]

    for i in range(m):
        for j in range(iA[i], iA[i+1]):
            col = jA[j]
            one = x[col]
            prod[i] += aA[j] * one

    return prod

start = time.process_time()

# Read info file 
N = 100001
with open("pages.info", "r") as f:
    print("File opened")
    # Loaded string is basically a source : destination dictionary
    # data dict will be the reversed (destination : source) dictionary
    data = { i : [] for i in range(N)}
    
    for i in range(N):
        # Create large data set for outgoing info / Load info
        line = f.readline()
        line_list = line.split()
        links = [int(element) for element in line_list[2:]]
        
        # Basically transposes the data before its turned into a matrix
        # i : the page of outgoing links
        # j : the index of the outgoing links
        # k-j: the amount of outgoing links which are duplicates of j
        # data[j] stores the incoming links to the page at j
        proportion = 1 / len(links)
        j = 0
        while j < len(links): # Iterate through each of the outgoing links
            k = j
            try: # Takes into account duplicate values on the proportion
                while links[k] == links[j]:
                    k += 1
            except IndexError:
                pass
            # Insert at the destination the source page
            # Also insert the proportion from the source that goes to the dest.
            data[links[j]].append((i, (k-j) * proportion))
            j = k
        
    print(f"Data read. {time.process_time() - start} seconds")
    end = time.process_time()
    

# Create the sparse matrix with the data dictionary
aA, jA, iA = [], [], []
for i in range(N):
    iA.append(len(aA)) # The destination/incoming link page
    for link in data[i]:
        aA.append(link[1]) # The proportion of links from the source page
        jA.append(link[0]) # The source page
iA.append(len(aA))

print(f"Sparse matrix created. {time.process_time() - end} seconds")
end = time.process_time()

# Relaxation Parameters
d = 0.85 # Dampening factor is [0, 1)
tol = 1 * (10**-6) # Tolerance

# Initial calculations
aA = [entry * d for entry in aA] # This is dM (in PageRank formula)
c = (1-d)/N # Calculate (1-d)/n 

# Get a random unit vector v
v = [random.randint(1, 100)/100 for _ in range(N)]
s = sum(v)
v = [e / s for e in v]

# Page Rank Algorithm Implementation
print(f"Beginning algorithm... Set-up took {time.process_time() - end} seconds")
end = time.process_time()
error = tol + 1
iterations = 0
while error > tol:
    iterations += 1
    # Save initial v for error calculation
    vlast = v

    # Formula is v = dMv + (1-d)/n*11^T*v
    # Calculate dM, then dMv
    dMv = sparse_mult((aA, jA, iA), v) # This is the left part
    
    # RHS is (1-d)/N * 11^T * v
    # Let c be (1-d)/N; 11^T is a nxn matrix of all 1s
    # The product of the 1 matrix by v gives the sum of v in all entries
    # That should be 1, so the right hand side is simply c
    right = [c for _ in v] 

    # Calculate the new v by adding the two things
    v = [dMv[i]+right[i] for i in range(N)]
    error = calc_error(v, vlast)
    print(f"Iteration {iterations}: {time.process_time() - end} seconds.")
    end = time.process_time()

print(f"This took {time.process_time() - start} seconds.\n\n")

# Analyze Data
res = [(i, e) for i, e in enumerate(v)]
res.sort(key=lambda e : e[1], reverse=True)

print("Pages ranked by probability and importance: Descending Order")
print(f"Rank |  Page  | Probability")
for i, page in enumerate(res[:5]): # 5 most important pages
    print(f"   {i+1} | {page[0]} | {page[1]} ")
print("...")
for i, page in enumerate(res[-5:]): # 5 least important pages
    print(f"{N-5+i} | {page[0]} | {page[1]} ")

print("\nRatio of most to least probabilistic page:", res[0][1]/res[-1][1])

